    }, {
      test: /\.css/,
      exclude: /module\.css/,
      loader: 'style-loader!css-loader!postcss-loader',
    }, {
      test: /\.ts(x?)$/,
      exclude: /node_modules/,
      loader: 'babel-loader!awesome-typescript-loader',
    }, {
      test: /\.js$/,
      loader: 'babel-loader',
      exclude: /node_modules/,
    }, {
